targets.expr:
sum by(service) (
  uploads{site=~"$site", service=~"$service"}
  or
  s3nd_upload_active{site=~"$site", service=~"$service"}
  or
  s3nd_upload_parts_active{site=~"$site", service=~"$service"}
)

sum (
  uploads{site=~"$site", service=~"$service"}
  or
  s3nd_upload_active{site=~"$site", service=~"$service"}
  or
  s3nd_upload_parts_active{site=~"$site", service=~"$service"}
)

avg by (service) (
  s3nd_s3_tcp_conn_pace_bytes{site=~"$site", service=~"$service"}
  unless on (site, service, instance)
  (s3nd_upload_parts_active{site=~"$site", service=~"$service"} == 0)
) * 8
